import React, { Component } from 'react'
import FetchService from '../helper/FetchService'
import YoutubeVideo from './subComponents/YoutubeVideo';
import YoutubeStoriesIFrame from './subComponents/YoutubeStoriesIFrame';



export default class StoriesFromYoutube extends Component {
    constructor() {
        super();
        this.state = {
            responseObject: {},
            loading: true,
        }
    }

    componentDidMount() {
        console.log("Mounted");
        FetchService.GET("https://youtube.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=50&playlistId=PLIy7-i_9rAyQ9teMuV1dJHWuVcsW5y39o&key=AIzaSyD2gBCggKBW5r6XkCzCa4dLoQuL7mnB9Ok")
            .then((res) => {
                // console.log(res['feed']['entry'][0]['content']['$t']);
                // this.setState({ responseObject: res['feed']['entry'] });
                var listFound = res.items
                this.setState({ responseObject: listFound });
                this.setState({ loading: false })
                console.log(listFound)
            })
    }

    getListOfVideoTitles(listFound) {

    }


    // Create Same for Iframes
    getStoriesToDisplay() {
        const youtubeItems = [];
        if (!this.state.loading) {
            for (var i = 0; i < this.state.responseObject.length; i++) {
                youtubeItems.push(
                    <YoutubeVideo
                        videoURL={this.state.responseObject[i]['snippet']['resourceID']['videoId']} />
                );
            }
        }
        return youtubeItems;
    }
    getIframesToDisplay() {
        const youtubeItems = [];
        if (!this.state.loading) {
            for (var i = 0; i < this.state.responseObject.length; i++) {
                youtubeItems.push(
                    <YoutubeStoriesIFrame videoURL={this.state.responseObject[i]['contentDetails']['videoId']} />
                );
            }
        }
        return youtubeItems;
    }

    render() {
        return (
            <div>
                {!this.state.loading &&
                    <>
                        {this.getStoriesToDisplay()}
                    </>
                }
            </div>
        )
    }
}
